import { HANDLE_INIT_PRODUCT } from "./constanst";
const initialState = {
    product: []
}
const productFootWearReducer = (state = initialState, action ) => {
    switch(action.type) {
        default:
            return state;
    }
}
export default productFootWearReducer;
